Le taux de chômage mesure le pourcentage de la population active \(personnes âgées de 15 à74 ans\) qui répond aux critères suivants : personnes n’ayant pas d'emploi, étant disponibles pour commencer à travailler dans les deux semaines et ayant activement recherché un emploi à un moment donné au cours des quatre dernières semaines.^[
